I think I kinda get why Gura keeps saying 9+10 is 11;
She kinda stresses getting it wrong, so she goes with overcomplicating it instead of relying on just "seeing it"; 
She treats 9 as being 1 away from a full 10 and the 10 is obviously a full 10, so when she combines the two under pressure, she combines the full 10 and accidentally the 1 that lacks from the other full 10 and suddenly blurts out 11.

I mean, it's totally incorrect, but I ... kinda get where the brainfart occurs. I tend to do treat numbers in a similar way. Like 8 in my brain is a number that always lacks a piece that is 2. So if someone asked me what's 10 + 8, I might derp it's 12 if I thought about the 10 and what 8 lacks, for whatever reason.
Yeah, idk. It's proobably a weird way of doing it, but that's just how my brain tends to treat the numbers.
